import {Link} from 'react-router-dom'

const User = (props, {onClick}) => {
    const name = props.userData.name;
    //const imgUrl = require(props.userData.avatar_url + "");
    const login = props.userData.login;
    const id = props.userData.id;
    const repos =props.reposData;

    let recentRepos = [];
    if (repos.length > 4) {recentRepos = repos.slice(0,4)} else {recentRepos = repos};
    const repoList = recentRepos.map((repo) =>
    <li key={repo.id}>
        <Link to='/repo'><button onClick={(repo)=>onClick(repo)}>{repo.name}</button></Link>
    </li>
    );

  return (
    <div>
        <h1>{name}</h1>
        <img src={props.userData.avatar_url} alt='userImg' />
        <p>login: {login}</p>
        <p>id: {id}</p>
        <h2>REPOS:</h2>
        <ul>{repoList}</ul>;

    </div>
  )
}

export default User
